@implementation NSString (ASDKFontGlyphicons)

#pragma mark -
#pragma mark Public interface

+ (NSString *)iconStringForIconType:(ASDKGlyphIconType)iconType {
    if (ASDKGlyphIconTypeUndefined != iconType) {
        return [NSString fontGlyphiconsUnicodeStrings][iconType];
    }
    return nil;
}

+ (ASDKGlyphIconType)iconTypeForIcontDescription:(NSString *)iconDescription {
    // First check if icon description is registered
    NSNumber *iconDescriptionCorrespondentValue = [self iconDescriptions][iconDescription];
    if (iconDescriptionCorrespondentValue) {
        return (ASDKGlyphIconType)[iconDescriptionCorrespondentValue integerValue];
    }
    
    return ASDKGlyphIconTypeUndefined;
}

- (NSString *)normalizedIconDescriptionName {
    return [self stringByReplacingOccurrencesOfString:@"glyphicon-"
                                           withString:@"glyphicons-"];
}

